import React from "react";
import Navbar from "../components/Navbar";
import styled from "styled-components";

const Container = styled.div`
    height: 60px
`;

const Wrapper = styled.div`
    padding: 10px;
    display: flex;
    align-items: center;
    justify-content: space-between;
`;

const Center = styled.div`
    flex: 1;
    text-align: center;
    justify-content: space-between;
`;

const Home = () => {
    return (
        <div>
            <Navbar/>
            <Container>
                <Wrapper>
                    <Center>
                        <select></select>
                    </Center>
                </Wrapper>
            </Container>
        </div>
    )
}
export default Home;
